# Complete the isValid function below.
def highestValuePalindrome(s, n, k):
    arr = [c for c in s]
    for i in range(n // 2):
        if arr[i] != arr[n - i - 1]:
            if k:
                k -= 1
            else:
                return "-1"
            val = max(arr[i], arr[n - i - 1])
            arr[i] = val
            arr[n - i - 1] = val
    i = 0
    while k:
        if i > n // 2:
            break

        if s[i] == s[n - i - 1]:
            if k < 2:
                break
            else:
                k -= 2
        else:
            k -= 1

        arr[i] = "9"
        arr[n - i - 1] = "9"

        i += 1

    if k and n == 1:
        arr[0] = "9"

    return "".join(arr)


